class ApiLibrary{

    GetThumbData = async (videoCode) => {
        
        let url = `${window.location.origin}/api/video/thumb/${videoCode}`;
        console.log(url)
        let json = await (
            await fetch(url)
        );

        console.log(json)
        json = json.json();
        console.log(json)

        return json
    };
}


export default ApiLibrary;
